import Reg from './components/Reg'
import './stylesheets/home.css'
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import Download from './components/Download';
import Home from './components/Home';
import { useNavigate } from 'react-router-dom';
const navigate = useNavigate();

useEffect(() => {
  // redirect to default category when `App` mounts
  navigate("/foo", { replace: true });
}, []);
function Main() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path='/Download' element={<Download></Download>}></Route>
                <Route path='/Reg' element={<Reg></Reg>}></Route>
                <Route path='/Home' index element={<Home></Home>} ></Route>
            </Routes>
        </BrowserRouter>
    )
}

export default Main
